INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('20266', '5642', 'ko', '0', '', '<strong>조심하세요!</strong> 실행 중인 다음 플러그인 버전은 최신 버전의 WooCommerce(%s)와 테스트되지 않았습니다.', '0', '', '0', '2018-06-20 09:52:30');
