INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('20268', '5644', 'ko', '0', '', '<strong>간편 상업 결제(Simplify Commerce payment) 게이트웨이는 더 이상 사용하지 마십시오.</strong> &#8211; WordPress.org에서 새로운 무료 간편 상업 플러그인(Simplify Commerce plugin)을 설치하십시오. Simplify Commerce는 차후 업데이트될 때 WooCommerce 코어에서 제거될 것입니다.', '0', '', '0', '2018-06-20 09:52:30');
