INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('20271', '5647', 'ko', '0', '', '<strong> 당신의 테마 (%s)는 구형 WooCommerce 템플릿 파일이 포함되어 있습니다. </strong> 현재 이용하고있는 WooCommerce 버전의 새로운 템플릿 파일로 바꿀 필요가 있습니다. %s 시스템 상태 페이지 %s에서 영향을받은 파일을 확인하십시오. 모르면 테마 작성자에게 확인하십시오.', '0', '', '0', '2018-06-20 09:52:30');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('20272', '5648', 'ko', '0', '', '<strong>테마에서 우커머스 지원을 선언하지 않았습니다.</strong> – <a href="%1$s" target="_blank">통합</a> 가이드를 읽거나, <a href="%2$s" target="_blank">Storefront</a> 테마를 확인하세요. 이 테마는 무료로 다운로드할 수 있고 우커머스에서 사용할 수 있게 특별히 디자인되었습니다.', '0', '', '0', '2018-06-20 09:52:30');
