INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('22055', '10174', 'ko', '0', '', '직접 제작한 테마가 아닌 경우 부모 테마의 우커머스 코드를 수정하는 것보다 하위 테마를 사용할 것을 권장합니다. 다음을 참고하세요: <a href="%s" target="_blank">하위 테마 생성하기</a>', '0', '', '0', '2018-06-20 09:52:31');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('22056', '10175', 'ko', '0', '', '계정을 만드는 경우 향후 주문에 대한 결제를 채우는 데 필요한 이름, 주소, 이메일 및 전화번호를 보관합니다.', '0', '', '0', '2018-06-20 09:52:31');
