INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('24207', '12342', 'ko', '0', '', '죄송합니다! 젯팩을 설치하려고 했지만 설치하지 못했습니다😭. 플러그인 탭으로 이동하여 설치하고 스토어 설정을 완료하세요.', '0', '', '0', '2018-06-20 09:52:31');
