INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('25086', '13230', 'ko', '0', '', '당사는 일반적으로 귀하에 대한 정보를 수집하여 사용할 목적을 위해 필요로 하는 한 정보를 보관하지만 법적으로 계속 보관할 필요는 없습니다. 예를 들면 워드프레스에서 세금 및 회계 목적으로 XXX년 동안 주문 정보를 보관합니다. 이름, 이메일 주소, 청구 및 배송 주소가 이에 해당됩니다.', '0', '', '0', '2018-06-20 09:52:37');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('25087', '13231', 'ko', '0', '', '귀하의 스토어 데이터베이스를 최신 버전으로 업데이트해야 합니다.', '0', '', '0', '2018-06-20 09:52:37');
